import RandomCatThings from './RandomCatThings';
import SavedCatThings from './SavedCatThings';
import {Route, Link} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Link to='/'>mi√©rt nem mennek a routeok?</Link>
      <br/>
      <Link to='/saved'>elmentett stuffi</Link>
      <br/>
      <Route exactpath="./" component={RandomCatThings}></Route>
      <Route exactpath="./saved" component={SavedCatThings}></Route>
    </div>
  );
}
export default App;
